        \u0073\u0074\u0061\u0074\u0069\u0063  \u0053\u0079\u0073\u0074\u0065\u006D .\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073 .\u0047\u0065\u006E\u0065\u0072\u0069\u0063 .\u004C\u0069\u0073\u0074 <\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0037\u0035\u0037 > \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0039\u0030  = \u006E\u0065\u0077  \u0053\u0079\u0073\u0074\u0065\u006D .\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073 .\u0047\u0065\u006E\u0065\u0072\u0069\u0063 .\u004C\u0069\u0073\u0074 <\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0037\u0035\u0037 >();

