\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0037\u0033\u0037 \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0038\u0030 ;
            \u0069\u0066  (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0037\u0038 .\u0043\u006F\u0075\u006E\u0074 > 0)
            {
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0038\u0030 = \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0037\u0038 [0];
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0037\u0038 .\u0052\u0065\u006D\u006F\u0076\u0065\u0041\u0074 (0);
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0038\u0030 .\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0037\u0033\u0039 (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0036\u0038\u0038 );
                \u0072\u0065\u0074\u0075\u0072\u006E  \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0038\u0030 ;
            }
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0038\u0030 = \u006E\u0065\u0077  \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0037\u0033\u0037 ();
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0038\u0031\u0038\u0030 .\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0037\u0033\u0039 (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0037\u0036\u0038\u0038 );
